//import { useState } from "react";
export default function Habits() {
  //const [haveHabits, setHaveHabits] = useState(false);
  return (
    <Container>
      <TitleHabits>
        <h1>Meus Hábitos</h1>
        <button>+</button>
      </TitleHabits>
      <FormHabits>
        <input placeholder="" />
      </FormHabits>
      <Text>
        Você não tem nenhum hábito cadastrado ainda. Adicione um hábito para
        começar a trackear!
      </Text>
    </Container>
  );
}
